["One way to run code when the user refreshes the browser in React is by using the `useEffect` hook and setting the `dependency` array to `[]`. This will cause the `useEffect` hook to run every time the component is rendered, including when the user refreshes the browser.

Here's an example:
```
import React, { useState, useEffect } from'react';
function MyComponent() {
  const [count, setCount] = useState(0);

  useEffect(() => {
    console.log('Component mounted.');
    return () => {
      console.log('Component unmounted.');
    }
  }, []);

  return (
    <div>
      <p>Count: {count}</p>
      <button onClick={() => setCount(count + 1)}>Increment</button>
    </div>
  );
}
```
