```java
int día = 3;
switch(día) {
  case 1:
    System.out.println("Lunes");
    break;
  case 2:
    System.out.println("Martes");
    break;
  case 3: 
    System.out.println("Miércoles");
    break;
  case 4:
    System.out.println("Jueves");
    break;
  case 5:
    System.out.println("Viernes");
    break;
  case 6:
    System.out.println("Sábado");
    break;
  case 7:
    System.out.println("Domingo");
    break;
  default:
    System.out.println("No es un día válido");
    break;
}
```

Este switch evalúa la variable "día" y compara su valor contra los diferentes case. Si coincide con alguno, entra en ese case y ejecuta el código correspondiente.

El break al final de cada case es importante para salir del switch una vez que se ha ejecutado el código de ese case.

El default se ejecuta si no coincide ningún caso. Es opcional, pero suele ser una buena práctica incluirlo.

Así es como funciona básicamente un switch en Java. Se puede utilizar para evaluar tanto variables numéricas como cadenas de texto."]

