    }
}
```

2. **Set the search path**: After connecting to the database, you can set the search path for the current session or for a specific user/role. To set the search path for the current session, you can use the `SET SEARCH_PATH` command directly in your SQL queries.

```sql
SET SEARCH_PATH TO desired_schema;
```

To set a permanent search path for a specific user/role, you can use the `ALTER DATABASE` command followed by the `SET SEARCH_PATH` command.

```sql
