3. **Modify JDBC URL**: Alternatively, you can use the JDBC URL to specify the current schema when connecting to the database. Since PostgreSQL version 9.4, there is support for specifying the current schema using the URL.

```sql
jdbc:postgresql://host:port/database_name?currentSchema=desired_schema
```

