["Here is how you can rewrite that jQuery code into vanilla JavaScript:

```js
const vdates = document.querySelector("#vdates");

const inputs = vdates.querySelectorAll(':input');

inputs.forEach(input => {
  input.disabled = false;
});
```

Breakdown:

- Use `document.querySelector()` to select the element with id "vdates"
- Use `querySelectorAll()` on that element to select all `:input` elements inside 
- Loop through the NodeList returned using forEach
- Set `disabled` property to false on each input

The key points:

- Use CSS selectors like jQuery 
- QuerySelector/querySelectorAll instead of $
- Loop and manually update properties instead of using .prop()

So this rewrites the jQuery to pure JavaScript DOM manipulation without any jQuery/library dependencies."]

